import React from "react";

function TextBanner() {
  return (
    <div>
      <div className="hero d-flex align-items-center wh-100">
        <div className="container-fluid">
          <div className="row justify-content-center">
            <div className="col-12 col-md-12 hero-text text-center text-white">
              <h4>
                Şöförlü Araç Kiralama İstanbul | SGS RENT A CAR Profesyonel
                çalışanları ile İstanbul'da saygın <br /> müşterilerine Şoförlü
                VIP Vito kiralama ve Şoförlü lüks Mercedes araç kiralama hizmeti
                sunmaktadır.
              </h4>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default TextBanner;
